                <App />
              </Route>
            {/* </li>
            <li> */}
              <Route path='/about'>
                <About />
              </Route>
            {/* </li>
          </ul> */}
        </Switch>
      </Router>
    </div>
  );
}

export default App;

function About() {
  return(
    <div>
      <h1>About</h1>
    </div>
  )
}
